set foreign_key_checks = 0;
drop table network_devices;
set foreign_key_checks = 1;
create table network_devices
(
  uid      int auto_increment primary key,
  ip       varchar(50) unique,
  hostname varchar(100) unique,
  platform varchar(30)
);
set foreign_key_checks = 0;
drop table interfaces;
set foreign_key_checks = 1;
create table interfaces
(
  uid              int auto_increment primary key,
  if_index         varchar(50),
  description      varchar(255),
  bandwith         bigint,
  l3_protocol      varchar(50),
  l3_protocol_attr varchar(50),
  l1_protocol      varchar(50),
  l1_protocol_attr varchar(50),
  data_flow        varchar(50),
  net_device_uid   int,
  foreign key (net_device_uid) references network_devices (uid)
);

set foreign_key_checks = 0;
drop table interface_states;
set foreign_key_checks = 1;

create table bgp_neighbors
(
  uid            int auto_increment primary key,
  ip             varchar(50),
  asn            int,
  address_family varchar(50),
  net_device_uid int,
  foreign key (net_device_uid) references network_devices (uid)
);


set foreign_key_checks = 0;
drop table bgp_neighbor_states;
set foreign_key_checks = 1;
create table bgp_neighbor_states
(
  uid                 int auto_increment primary key,
  state               VARCHAR(50),
  last_error          VARCHAR(50),
  advertised_prefixes int,
  accepted_prefixes   int,
  state_timestamp     datetime,
  bgp_neighbor_uid    int,
  foreign key (bgp_neighbor_uid) references bgp_neighbors (uid)
);

select *
from interfaces as i
       inner join network_devices as n on n.uid = i.net_device_uid
where n.ip = '172.16.30.13';

select *
from interfaces
where net_device_uid = 1
select *
from interface_states
where interface_uid = 56505
select *
from interfaces
order by uid DESC
limit 100
SELECT uid,if_index,l3_protocol,l3_protocol_attr,l1_protocol,l1_protocol_attr,data_flow
FROM interfaces
WHERE net_device_uid = 2
ORDER BY uid DESC;

select *
from network_devices;
SELECT i.uid      as uid,
       i.if_index as if_index,
       i.l3_protocol,
       i.l3_protocol_attr,
       i.l1_protocol,
       i.l1_protocol_attr,
       i.data_flow,
       s.util_in  as util_in,
       s.util_out as util_out,
       s.link_state,
       s.protocol_state,
       s.output_rate,
       s.input_rate,
       s.state_timestamp,
       i.ip

from network_devices as d
       inner join interfaces as i on d.uid = i.net_device_uid
       inner join (select * from interface_states where DATE(state_timestamp) = DATE(NOW())) as s
                  on s.interface_uid = i.uid
       inner join (select max(uid) as uid from interface_states group by interface_uid) as s2 on s2.uid = s.uid
WHERE net_device_uid = 1
  and state_timestamp >= '2019-05-07 00:00:00'
  and state_timestamp <= '2019-05-07 23:59:00'


